import json
import pandas as pd
import numpy as np
from scipy import stats

# Read water testing data
def read_water_testing_data(year):
    filename = f'water-body-testing-{year}.csv'
    df = pd.read_csv(filename)
    df['Sample Date'] = pd.to_datetime(df['Sample Date'])
    df['Month'] = df['Sample Date'].dt.month
    return df

# Read precipitation data
def read_precipitation_data(region):
    filename = f'monthly_precipitations_{region.lower()}.csv'
    df = pd.read_csv(filename)

    # Convert Year to string to ensure consistent type
    df['Year'] = df['Year'].astype(str)

    # Convert precipitation values, handling 'M' values
    for month in ['Jun', 'Jul', 'Aug']:
        df[month] = pd.to_numeric(df[month], errors='coerce')

    return df

# Calculate exceedance rates
def calculate_exceedance_rates():
    exceedance_rates = []

    for year in range(2007, 2010):
        df = read_water_testing_data(year)

        # Filter summer months
        summer_data = df[df['Month'].isin([6, 7, 8])]

        # Calculate exceedance rate by beach type and month
        for beach_type in ['Fresh', 'Marine']:
            for month in [6, 7, 8]:
                month_data = summer_data[
                    (summer_data['Beach Type Description'] == beach_type) & 
                    (summer_data['Month'] == month)
                ]
                if len(month_data) > 0:
                    exceedance_rate = (month_data['Violation'] == 'yes').mean()
                else:
                    exceedance_rate = np.nan

                exceedance_rates.append({
                    'Year': year,
                    'Month': month,
                    'Beach_Type': beach_type,
                    'Exceedance_Rate': exceedance_rate
                })

    return pd.DataFrame(exceedance_rates)

# Calculate average rainfall
def calculate_average_rainfall():
    fresh_regions = ['boston', 'chatham', 'amherst', 'ashburnham']
    marine_regions = ['boston', 'chatham']

    rainfall_data = {}
    for region in set(fresh_regions + marine_regions):
        df = read_precipitation_data(region)
        rainfall_data[region] = df

    rainfall_averages = []
    years = ['2007', '2008', '2009']
    months = {'Jun': 6, 'Jul': 7, 'Aug': 8}

    for year in years:
        for month_name, month_num in months.items():
            # Calculate for fresh water beaches
            fresh_values = []
            for region in fresh_regions:
                value = rainfall_data[region][
                    rainfall_data[region]['Year'] == year
                ][month_name].iloc[0]
                if pd.notna(value):
                    fresh_values.append(value)

            # Calculate for marine beaches
            marine_values = []
            for region in marine_regions:
                value = rainfall_data[region][
                    rainfall_data[region]['Year'] == year
                ][month_name].iloc[0]
                if pd.notna(value):
                    marine_values.append(value)

            rainfall_averages.append({
                'Year': int(year),
                'Month': month_num,
                'Fresh_Rainfall': np.mean(fresh_values) if fresh_values else np.nan,
                'Marine_Rainfall': np.mean(marine_values) if marine_values else np.nan
            })

    return pd.DataFrame(rainfall_averages)

# Calculate correlations
def calculate_correlations():
    exceedance_df = calculate_exceedance_rates()
    rainfall_df = calculate_average_rainfall()

    # Merge the data
    merged_fresh = pd.merge(
        exceedance_df[exceedance_df['Beach_Type'] == 'Fresh'],
        rainfall_df[['Year', 'Month', 'Fresh_Rainfall']],
        on=['Year', 'Month']
    )

    merged_marine = pd.merge(
        exceedance_df[exceedance_df['Beach_Type'] == 'Marine'],
        rainfall_df[['Year', 'Month', 'Marine_Rainfall']],
        on=['Year', 'Month']
    )

    # Calculate correlations
    fresh_corr = stats.pearsonr(
        merged_fresh['Fresh_Rainfall'].fillna(merged_fresh['Fresh_Rainfall'].median()),
        merged_fresh['Exceedance_Rate'].fillna(merged_fresh['Exceedance_Rate'].median())
    )[0]

    marine_corr = stats.pearsonr(
        merged_marine['Marine_Rainfall'].fillna(merged_marine['Marine_Rainfall'].median()),
        merged_marine['Exceedance_Rate'].fillna(merged_marine['Exceedance_Rate'].median())
    )[0]

    result = {
        'Fresh_Water_Correlation': fresh_corr,
        'Marine_Water_Correlation': marine_corr,
        'Higher_Correlation': 'Fresh Water' if fresh_corr > marine_corr else 'Marine'
    }

    return result

# Execute and print results
results = calculate_correlations()
